import React from "react";

const Search = ({ handleSearchModal }) => {
  return (
    <div
      className="fixed top-0 left-0 right-0 bottom-0 bg-modal z-50"
      onClick={handleSearchModal}
    >
      <div className="" onClick={(e) => e.stopPropagation}>
        <div className=""></div>
      </div>
    </div>
  );
};

export default Search;
